const messages = [
    {
        author: "Emma",
        text: "Hey, how are you doing?",
    },
    {
        author: "Liam",
        text: "Did you catch the game last night?",
    },
    {
        author: "Olivia",
        text: "Can you believe it's already April?",
    },
    {
        author: "William",
        text: "Have you seen any good movies lately?",
    },
    {
        author: "Ava",
        text: "I'm thinking of trying out that new restaurant, want to come with?",
    },
    {
        author: "James",
        text: "What do you think of the new project we're working on?",
    },
    {
        author: "Sophia",
        text: "I'm so excited for our upcoming vacation!",
    },
    {
        author: "Benjamin",
        text: "Have you heard about that new book that just came out?",
    },
    {
        author: "Mia",
        text: "I'm feeling a bit under the weather today :(",
    },
    {
        author: "Ethan",
        text: "Did you see the news about the tech industry?",
    },
];

export default messages;
